import React from "react";
import {Link} from 'react-router-dom';

let ContactList = () => {
    return (
      <React.Fragment>
        <section className="contact-search">
          <div className="container">
            <div className="grid">
              <div className="row">
                <div className="col">
                  <p className="h3">Contact Manager
                    <Link to={'/contacts/add'}>
                    </Link>
                  </p>
                </div>
              </div>
            </div>
          </div>

        </section>
      </React.Fragment>  
    )
};

export default ContactList;
